class JSONOutlineSchemaItem{constructor(){this.id="item-"+this.generateUUID();this.ident=0;this.location="";this.order=0;this.parent="";this.title="New item";this.description="";this.metadata={}}readLocation(basePath=""){return FALSE}writeLocation(basePath=""){return FALSE}generateUUID(){return"ss-s-s-s-sss".replace(/s/g,this._uuidPart)}_uuidPart(){return Math.floor(65536*(1+Math.random())).toString(16).substring(1)}}export{JSONOutlineSchemaItem};